import React from 'react';



const Header = ()=>{
    const prevent = (event)=>{
        event.preventDefault();
    }
    return (
        <form onChange={prevent}>
           <input type = 'text' placeholder = 'Title' />
           <br></br>
           <input type = 'text' placeholder = 'Write a note..' /> 
        </form>
    );
}

 export default Header;
